    sno : string;
    name : string;
    age : number;
    designation : string;
    location : string;
}


interface IProps {}
interface IState {
    employees : IEmployee[]
}

let EmployeeCards:React.FC<IProps> =() =>{
    let [employeeState,setEmployeeState] = useState<IState>({
        employees :[
            {
                sno : 'AA00101',
                name : 'Rajan',
                age : 25,
                designation : 'Software Engineer',
                location : 'Bangalore'
            },
            {
                sno : 'AA00102',
                name : 'Mahesh',
                age : 28,
                designation : 'Sr.Software Engineer',
                location : 'Bangalore'
            },
            {
                sno : 'AA00103',
                name : 'John',
                age : 45,
                designation : 'Project Manager',
                location : 'Bangalore'
            },
            {
                sno : 'AA00104',
                name : 'Wilson',
                age : 48,
                designation : 'Director',
                location : 'Bangalore'
            }
        ]
    });
    let{employees} = employeeState;

    return(
        <React.Fragment>
            <h2> EmployeeCards Components</h2>

        </React.Fragment>
    )
};
export default EmployeeCards;
